#!/usr/bin/env python3

YES = "Yes"  # type: str
NO = "No"  # type: str


# Generated by 2.9.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    S = set()
    T = set()
    H, W = map(int, input().split())
    for i in range(H):
        l = input()
        for j in range(W):
            if l[j] == ".":
                S.add((i, j))
    for i in range(H):
        l = input()
        for j in range(W):
            if l[j] == "#":
                T.add((i, j))
    
    for _ in range(4):
        minx, miny = min(T)
        tt = set((x - minx, y - miny) for x, y in T)
        for minx in range(H):
            for miny in range(W):
                ss = set((x - minx, y - miny) for x, y in S)
                if tt <= ss:
                    print(YES)
                    return
        T = set((y, -x) for x, y in T)
    print(NO)
    return
    

if __name__ == '__main__':
    main()
